package com.javalec.dto;

public class Dtoemployee {
	String eid;	
	String ename;	
	String erank;	
	String eindate;	
	String eoutdate;	
	String epw;
public Dtoemployee() {
	// TODO Auto-generated constructor stub
}
public String getEid() {
	return eid;
}
public void setEid(String eid) {
	this.eid = eid;
}
public String getEname() {
	return ename;
}
public void setEname(String ename) {
	this.ename = ename;
}
public String getErank() {
	return erank;
}
public void setErank(String erank) {
	this.erank = erank;
}
public String getEindate() {
	return eindate;
}
public void setEindate(String eindate) {
	this.eindate = eindate;
}
public String getEoutdate() {
	return eoutdate;
}
public void setEoutdate(String eoutdate) {
	this.eoutdate = eoutdate;
}
public String getEpw() {
	return epw;
}
public void setEpw(String epw) {
	this.epw = epw;
}

}
